import React, {useState} from 'react'; 
// import './GamesList.css';


const PGNDialog = ({text, closePopup}) => {

	const [input, setInput] = useState('');

	return (
			<div id="pgn_container">
				<h1>{text}</h1> 
				<textarea 
					placeholder="Enter something" 
					onChange={() => setInput(e.target.value)} 
					value={input}
					// value="https://lichess.org/game/export/6dFspuKY" 
					id="inputpgn" /> 
				<span 
					id="popupsubmit" 
					className='pointer' 
					value="submit" 
					onClick={()=>closePopup(document.getElementById('inputpgn').value)}>
					Submit
				</span>
			</div>
		);
}



export default PGNDialog;
